import React, { useState } from 'react';
import Axios from 'axios';

const Calendar = () => {
    const [listAllTimes, setListAllTimes] = useState([]);

    useEffect(() => {
        Axios.get('http://localhost:3001/getTimes')
            .then((response) => {
                console.log('response.data: ', response.data);
                setListAllTimes(response.data);
            })
    }, [listAllTimes])
console.log('listAllTimes: ', listAllTimes);
    return (
        <div>Calendar</div>
    )
}

export default Calendar
